import React from 'react'

export const Hero = () => {
  return (
    <section className=' flex bg-img bg-[#0A0A0B] w-[100%]'>
        <div>
        <div style={{width: '100%', height: '100%', background: 'radial-gradient(102.78% 102.78% at 102.78% 51.39%, white 0%, white 27%, #38E7FF 60%, #60B3FF 62%, #193749 100%)'}}></div>
        </div>
    </section>
  )
}
